from typing import List


def calculate_product_of_sums(x: float, y: float, z: float) -> float:
    """Calculate the product of three sums: (x+y) * (y+z) * (x+z)."""
    if not _all_positive(x, y, z):
        return 0

    sum_xy = x + y
    sum_yz = y + z
    sum_xz = x + z

    return sum_xy * sum_yz * sum_xz


def _all_positive(*values: float) -> bool:
    """Check if all values are positive."""
    return all(value > 0 for value in values)


def calculate_sum(numbers: List[float]) -> float:
    """Calculate the sum of all numbers in the list."""
    return sum(numbers)

